class Solution:
    def maximalRectangle2(self, matrix):
        if not matrix:
            return 0
        row = len(matrix)
        col = len(matrix[0])

        height = [0] * col
        res = float("-inf")
        for i in range(0, row):
            for j in range(0, col):
                if matrix[i][j] == "1":
                    height[j] += 1
                else:
                    height[j] = 0
            left = [0] * col
            right = [0] * col
            left[0] = 0
            for i in range(1, col):
                if height[i] > height[left[i - 1]]:
                    left[i] = i
                else:
                    if height[i - 1] == 0:
                        left[i] = i
                    else:
                        left[i] = left[i - 1]
            right[-1] = col - 1
            for j in range(col - 2, -1, -1):
                if height[j] > height[right[j + 1]]:
                    right[j] = j
                else:
                    if height[j + 1] == 0:
                        right[j] = j
                    else:
                        right[j] = right[j + 1]
            print(height)
            print(left)
            print(right)

            for t in range(col):
                res = max(res, height[t] * (right[t] - left[t] + 1))
            print(res)
            print("--------")
        return res

    def maximalRectangle1(self, matrix):
        if not matrix:
            return 0
        row = len(matrix)
        col = len(matrix[0])
        height = [0] * col
        self.res = 0

        def monotonic_stack(height):
            stack = []
            height = [0] + height + [0]
            for k in range(col + 2):
                while stack and (height[stack[-1]] > height[k]):
                    t = stack.pop()
                    self.res = max(self.res, (k - stack[-1] - 1) * height[t])
                stack.append(k)

        for i in range(row):
            for j in range(col):
                if matrix[i][j] == "1":
                    height[j] += 1
                else:
                    height[j] = 0
            monotonic_stack(height)

        return self.res

    def maximalRectangle6(self, matrix):
        if not matrix or not matrix[0]: return 0
        row = len(matrix)
        col = len(matrix[0])
        # print(row, col)
        dp = [[0] * (col + 1) for _ in range(row + 1)]

        for i in range(1, row + 1):
            for j in range(1, col + 1):
                dp[i][j] = int(matrix[i - 1][j - 1]) + dp[i - 1][j] + dp[i][j - 1] - dp[i - 1][j - 1]
        # print(dp)
        res = 0
        for i in range(1, row + 1):
            for j in range(1, col + 1):
                for s in range(i - 1, -1, -1):
                    flag = -1
                    for t in range(j - 1, -1, -1):
                        tmp = dp[i][j] - dp[s][j] - dp[i][t] + dp[s][t]
                        # print(i, j, s, t, tmp)
                        if tmp == (i - s) * (j - t):
                            res = max(res, tmp)
                        else:
                            flag = t
                            break
                    if t < flag:
                        break
        return res

    def maximalRectangle(self, matrix):
        if not matrix or not matrix[0]: return 0
        row = len(matrix)
        col = len(matrix[0])
        left_j = [-1] * col
        right_j = [col] * col
        height_j = [0] * col
        res = 0
        for i in range(row):
            cur_left = -1
            cur_right = col

            for j in range(col):
                if matrix[i][j] == "1":
                    height_j[j] += 1
                else:
                    height_j[j] = 0

            for j in range(col):
                if matrix[i][j] == "1":
                    left_j[j] = max(left_j[j], cur_left)
                else:
                    left_j[j] = -1
                    cur_left = j

            for j in range(col - 1, -1, -1):
                if matrix[i][j] == "1":
                    right_j[j] = min(right_j[j], cur_right)
                else:
                    right_j[j] = col
                    cur_right = j
            for j in range(col):
                res = max(res, (right_j[j] - left_j[j] - 1) * height_j[j])
        return res


